import React from 'react';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import SearchIcon from '@material-ui/icons/Search';
import InfoIcon from '@material-ui/icons/Info';
import { makeStyles } from '@material-ui/core/styles';
import './index.scss';

const useStyles = makeStyles((theme) => ({
  image: {
    backgroundImage: 'url(https://source.unsplash.com/random)',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  logoBig:{
    marginTop: 22,
    marginBottom: 40,
    backgroundColor: '#DEDEDE',
    color: '#FFFFFF',
  },
 loginButton: {
    backgroundColor: '#4E5674',
    borderRadius: 10,
    width: 150,
    height: 50,
  },
  root: {
    width: '100%',
  },
  aling:{
    display: 'flex',
    paddingLeft: 15
  },
  formTotal:{
    marginBottom: 40,
  }

}));

function getSteps() {
  return ['Primer paso', 'Segundo paso', 'Tercer paso', 'Cuarto paso'];
}

export const RegisterFourth = () => {
  const classes = useStyles();
  const [activeStep] = React.useState(0);
  const steps = getSteps();

  return (
    <Grid container component="main" className={classes.root}>

      <Grid item xs={false} sm={3} md={3} className={classes.image} />
      <Grid item xs={12} sm={9} md={9} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="contained" className={classes.logoBig}>Logo</Button>

          <Stepper activeStep={activeStep} alternativeLabel>
            {steps.map((label) => (
              <Step key={label}>
                <StepLabel>{label}</StepLabel>
              </Step>
            ))}
          </Stepper>

          <form className={classes.formTotal} noValidate>
            <p className='textAv'>Avatar para pantalla completa</p>
            <div className={classes.aling}>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              className='loginButton'
            >
              <SearchIcon/> Archivo de imagen
            </Button>
            <p className='textSelec'>Selecionar archivo</p>
            </div>
            <p className='tamañoRecomendado'> <InfoIcon/> Tamaño recomendado 180 X 180 px</p>
          </form>

          <form className={classes.form} noValidate>
            <p className='textAv'>Avatar para pantalla pequeña</p>
            <div className={classes.aling}>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              className='loginButton'
            >
              <SearchIcon/> Archivo de imagen
            </Button>
            <p className='textSelec'>Selecionar archivo</p>
            </div>
            <p className='tamañoRecomendado'> <InfoIcon/> Tamaño recomendado 120 X 120 px</p>
          </form> 

          <form className={classes.form} noValidate>
            <p className='textBa'>Banner</p>
            <div className={classes.aling}>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              className='loginButton'
            >
              <SearchIcon/> Archivo de imagen
            </Button>
            <p className='textSelec'>Selecionar archivo</p>
            </div>
            <p className='tamañoRecomendado'> <InfoIcon/> Tamaño recomendado 180 X 250 px</p>
          </form>

          <div className='login'>
              <Button
                type="submit"
                variant="contained"
                color="primary"
                className={classes.loginButton}
              >
                Siguiente
              </Button>  
            </div>
        </div>
      </Grid>
    </Grid>    
  );
}
